#include <vector>
#include <iostream>

using namespace std;

class Solution {
public:
  int longestOnes(vector<int> &A, int K) {
    if (K >= A.size()) {
      return A.size();
    }
    vector<int> help;
    for (int i = 0; i < A.size(); i++) {
      if (A[i] == 0) {
        help.emplace_back(i);
      }
    }
    if (K >= help.size()) {
      return A.size();
    }
    int ans = 0;
    for (int i = 0; i <= help.size() - K; i++) {
      // 最大的肯定是连续翻转0的
      // 左边0界
      int l = (i == 0) ? -1 : help[i - 1];
      // 右边0界
      int r = (i + K == help.size()) ? A.size() : help[i + K];
      ans = max(r - l - 1, ans);
    }
    return ans;
  }
};

